import React from "react";

function PlaceOrder(){
    const placeOrder = () => {
        alert("YOUR ORDER HAS SUCCESSFULLT PLACED");
    }

    return (<button onClick={placeOrder}> CLICK TO PLACE ORDER</button>);
}
export default  PlaceOrder;
